import React from 'react';

const ImagePreview = props => {
    return (
        <div className='ImagePreview VideoInformationSection'>
            <div className="title">
                <p>Image Preview</p>
            </div>
            <div className="editor">
                <img src={props.postData.mainThumbnail}/>
            </div>
        </div>
    );
};
export default ImagePreview;
